import "./countries.css"

const Countries = ({countries}) => {

    return (
            <div className="mainDiv">
                {
                    countries.map((country) => {
                        return <>
                            <h1>{country.name}</h1>
                        </>
                    })
                }
            </div>
    )
}

export default Countries
